import React from 'react';


function Joplin() {
    return (
        <div>
            <h1>Your style icon match is Janis Joplin! </h1>
            <img className='resultImg' alt="" src="https://www.jambase.com/wp-content/uploads/2015/10/janisjoplinpressimagecrop.jpg" />
            <h3 className='resultDescr'>You gravitate toward a bohemian vibe, and prefer a more laid back, ecclectic approach to your closet and styling choices.</h3>
        </div>
    );
};



export default Joplin;
